import React from 'react'
import {
    Box
} from '@chakra-ui/react'

function Header(props){
    return(
        <Box
        as= 'div'
        w="full"
        h="150px"
        border="1px"
        display="flex"
        direction="inline-flex">
            <p>Hola</p>
            <p>Soy leiton</p>
        </Box>
    )
}


export default Header
